import React from 'react';

const ProjectsSection = () => {
  return (
    <div className="flex items-stretch gap-2 px-4 py-2" style={{paddingLeft: '15px', paddingRight: '12px'}}>
      <div className="w-5 h-5 text-ella-blue mt-0.5">
        <svg fill="currentColor" viewBox="0 0 24 24">
          <path d="M19 3H5c-1.1 0-2 .9-2 2v14c0 1.1.9 2 2 2h14c1.1 0 2-.9 2-2V5c0-1.1-.9-2-2-2zm-5 14H7v-2h7v2zm3-4H7v-2h10v2zm0-4H7V7h10v2z"/>
        </svg>
      </div>
      <span className="font-semibold text-ella-blue font-geist leading-6 flex items-center" style={{width: '65px'}}>Projects</span>

      <div className="relative flex items-center mt-0.5" style={{width: '189.82px', marginLeft: '7.17px', paddingLeft: '10px', paddingTop: '10px', paddingBottom: '9px'}}>
        <div className="text-xs text-gray-400 italic leading-3 text-right flex items-center justify-end" style={{width: '154.82px', fontSize: '10px', lineHeight: '12px', color: '#C5C6C8'}}>
          + create a project
        </div>
        <div className="absolute w-5 h-5 text-gray-400" style={{left: '169.83px', top: '0px'}}>
          <svg fill="currentColor" viewBox="0 0 24 24">
            <path d="M19 13h-6v6h-2v-6H5v-2h6V5h2v6h6v2z"/>
          </svg>
        </div>
      </div>
    </div>
  );
};

export default ProjectsSection;
